    data: |
      SELECT DISTINCT + col0 + - col1 - - 88 + + 36 * - ( + 93 ) * + + ( col0 ) / col0 AS col2 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q171.out
    data: |
      -3164
      -3194
      -3326
